function App(){
    const User = require('./Card.js');
    var firstCard = new Card("front", "back");

    const test = document.createElement("label");
    test.innerHTML = firstCard.getFront();

    firstCard.setFront("new");
    test.innerHTML = firstCard.getFront();

    document.body.appendChild(test);
}

var Card = function(){
    this.front = front;
    this.back = back;
    this.star = star;

    Card.prototype.getFront = function() {
        return front;
    }
    Card.prototype.getBack = function() {
        return back;
    }
    Card.prototype.setFront = function(front) {
        this.front = front;
    }
    Card.prototype.setBack = function(back) {
        this.back = back;
    }
}

export default App;
